    "Deleting a team is permanent and cannot be undone. All members are removed from the team, and team discussions can no longer be accessed.": "\u062d\u0630\u0641 \u06cc\u06a9 \u062a\u06cc\u0645 \u063a\u06cc\u0631\u200c\u0642\u0627\u0628\u0644 \u0628\u0627\u0632\u06af\u0634\u062a \u0645\u06cc\u200c\u0628\u0627\u0634\u062f. \u062a\u0645\u0627\u0645\u06cc \u0627\u0639\u0636\u0627 \u0627\u0632 \u062a\u06cc\u0645 \u062d\u0630\u0641 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f\u060c \u0648 \u06af\u0641\u062a\u06af\u0648\u200c\u0647\u0627\u06cc \u062a\u06cc\u0645 \u062f\u06cc\u06af\u0631 \u0642\u0627\u0628\u0644 \u062f\u0633\u062a\u0631\u0633\u06cc \u0646\u0645\u06cc\u200c\u0628\u0627\u0634\u062f.", 
    "Deleting a textbook cannot be undone and once deleted any reference to it in your courseware's navigation will also be removed.": "\u062d\u0630\u0641 \u06cc\u06a9 \u06a9\u062a\u0627\u0628 \u062f\u0631\u0633\u06cc \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u0642\u0627\u0628\u0644 \u0628\u0627\u0632\u06af\u0634\u062a \u0628\u0627\u0634\u062f \u0648 \u06cc\u06a9 \u0628\u0627\u0631 \u062d\u0630\u0641 \u0647\u0631 \u06af\u0648\u0646\u0647 \u0627\u0634\u0627\u0631\u0647 \u0628\u0647 \u0622\u0646 \u067e\u06cc\u0645\u0627\u06cc\u0634 \u062f\u0631\u0648\u0633 \u0634\u0645\u0627 \u0646\u06cc\u0632 \u067e\u0627\u06a9 \u062e\u0648\u0627\u0647\u062f \u0634\u062f.", 
