    "EdX doesn't have a timed transcript for this video in Studio, but we found a transcript on YouTube. You can import the YouTube transcript or upload your own .srt transcript file.": "\u062f\u0631 \u0627\u062f\u06a9\u0633 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633\u06cc \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0641\u06cc\u0644\u0645 \u067e\u06cc\u062f\u0627 \u0646\u0634\u062f \u0648\u0644\u06cc \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u0622\u0646 \u062f\u0631 \u0641\u06cc\u0644\u0645\u200c\u0646\u06af\u0627\u0631 \u067e\u06cc\u062f\u0627 \u0634\u062f\u0647 \u0627\u0633\u062a. \u0634\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u067e\u06cc\u062f\u0627 \u0634\u062f\u0647 \u0631\u0627 \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u06a9\u0646\u06cc\u062f \u06cc\u0627 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u0634\u062e\u0635\u06cc \u062e\u0648\u062f \u0631\u0627 \u0628\u0627 \u0641\u0631\u0645\u062a srt. \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f.", 
    "EdX doesn\\'t have a timed transcript for this video. Please upload an .srt file.": "\u0647\u06cc\u0686 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633\u06cc \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0641\u06cc\u0644\u0645 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f. \u0644\u0637\u0641\u0627 \u06cc\u06a9 \u0641\u0627\u06cc\u0644 srt. \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f.", 
    "EdX has a timed transcript for this video. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript. If you want to replace this transcript, upload a new .srt transcript file.": "\u062f\u0631 \u0627\u062f\u06a9\u0633 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633\u06cc \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0641\u06cc\u0644\u0645 \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f. \u0627\u06af\u0631 \u062a\u0645\u0627\u06cc\u0644 \u0628\u0647 \u0648\u06cc\u0631\u0627\u06cc\u0634 \u0627\u06cc\u0646 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u062f\u0627\u0631\u06cc\u062f\u060c \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u06cc\u0627\u0641\u062a \u0634\u062f\u0647 \u0631\u0627 \u062f\u0627\u0646\u0644\u0648\u062f\u060c \u0648\u06cc\u0631\u0627\u06cc\u0634 \u0648 \u0645\u062c\u062f\u062f\u0627 \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f. \u0686\u0646\u0627\u0646\u0686\u0647 \u062a\u0645\u0627\u06cc\u0644 \u0628\u0647 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646\u06cc \u0627\u06cc\u0646 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u062f\u0627\u0631\u06cc\u062f\u060c \u06cc\u06a9 \u0641\u0627\u06cc\u0644 srt. \u062c\u062f\u06cc\u062f \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f.", 
    "EdX has a timed transcript for this video. If you want to replace this transcript, upload a new .srt transcript file. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript.": "\u062f\u0631 \u0627\u062f\u06a9\u0633 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633\u06cc \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0641\u06cc\u0644\u0645 \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f. \u0686\u0646\u0627\u0646\u0686\u0647 \u062a\u0645\u0627\u06cc\u0644 \u0628\u0647 \u062c\u0627\u06cc\u06af\u0632\u06cc\u0646\u06cc \u0627\u06cc\u0646 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u062f\u0627\u0631\u06cc\u062f\u060c \u06cc\u06a9 \u0641\u0627\u06cc\u0644 srt. \u062c\u062f\u06cc\u062f \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f. \u0627\u06af\u0631 \u062a\u0645\u0627\u06cc\u0644 \u0628\u0647 \u0648\u06cc\u0631\u0627\u06cc\u0634 \u0627\u06cc\u0646 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u062f\u0627\u0631\u06cc\u062f\u060c \u0645\u06cc\u062a\u0648\u0627\u0646\u06cc\u062f \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u06cc\u0627\u0641\u062a \u0634\u062f\u0647 \u0631\u0627 \u062f\u0627\u0646\u0644\u0648\u062f\u060c \u0648\u06cc\u0631\u0627\u06cc\u0634 \u0648 \u0645\u062c\u062f\u062f\u0627 \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f.", 
    "Edit": "\u0648\u06cc\u0631\u0627\u06cc\u0634", 
