    "Edit your post below.": "\u067e\u0633\u062a \u062e\u0648\u062f \u0631\u0627 \u062f\u0631 \u0632\u06cc\u0631 \u0648\u06cc\u0631\u0627\u06cc\u0634 \u06a9\u0646\u06cc\u062f.", 
    "Editable": "\u0642\u0627\u0628\u0644 \u0648\u06cc\u0631\u0627\u06cc\u0634", 
    "Editing access for: %(title)s": "\u0648\u06cc\u0631\u0627\u06cc\u0634 \u062f\u0633\u062a\u0631\u0633\u06cc \u0628\u0631\u0627\u06cc: %(title)s", 
    "Editing comment": "\u062f\u0631 \u062d\u0627\u0644 \u0648\u06cc\u0631\u0627\u06cc\u0634 \u0646\u0638\u0631", 
