    "Editing response": "\u0648\u06cc\u0631\u0627\u06cc\u0634 \u067e\u0627\u0633\u062e \u0647\u0627", 
    "Editing visibility for: %(title)s": "\u062f\u0631 \u062d\u0627\u0644 \u062a\u0646\u0638\u06cc\u0645 \u062d\u0627\u0644\u062a \u0646\u0645\u0627\u06cc\u0634 \u0628\u0631\u0627\u06cc : %(title)s", 
    "Editing: %(title)s": "\u0648\u06cc\u0631\u0627\u06cc\u0634 %(title)s", 
