    "Email": "\u067e\u0633\u062a \u0627\u0644\u06a9\u062a\u0631\u0648\u0646\u06cc\u06a9\u06cc", 
    "Email Address": "\u0622\u062f\u0631\u0633 \u067e\u0633\u062a \u0627\u0644\u06a9\u062a\u0631\u0648\u0646\u06cc\u06a9\u06cc", 
    "Emails successfully sent. The following users are no longer enrolled in the course:": "\u0627\u06cc\u0645\u06cc\u0644 \u0647\u0627 \u0628\u0627 \u0645\u0648\u0641\u0642\u06cc\u062a \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u0632\u06cc\u0631 \u062f\u06cc\u06af\u0631 \u062f\u0631 \u062f\u0648\u0631\u0647 \u0639\u0636\u0648 \u0646\u0645\u06cc \u0628\u0627\u0634\u0646\u062f:", 
    "Enable Cohorts": "\u0641\u0639\u0627\u0644\u200c\u0633\u0627\u0632\u06cc \u06af\u0631\u0648\u0647\u200c\u0647\u0627\u06cc \u0622\u0645\u0648\u0632\u0634\u06cc", 
    "End": "\u067e\u0627\u06cc\u0627\u0646", 
    "End of transcript. Skip to the start.": "\u067e\u0627\u06cc\u0627\u0646 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633. \u0628\u0631\u0627\u06cc \u067e\u0631\u0634 \u0628\u0647 \u0627\u0628\u062a\u062f\u0627\u06cc \u0622\u0646 \u06a9\u0644\u06cc\u06a9 \u06a9\u0646\u06cc\u062f.", 
    "Engage with posts": "\u062a\u0639\u0627\u0645\u0644 \u0628\u0627 \u067e\u0633\u062a\u200c\u0647\u0627", 
    "Enrolling you in the selected course": "\u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u0634\u0645\u0627 \u062f\u0631 \u062f\u0648\u0631\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0634\u062f\u0647", 
    "Enrollment Date": "\u062a\u0627\u0631\u06cc\u062e \u062b\u0628\u062a \u0646\u0627\u0645", 
    "Enrollment Tracks": "\u0646\u0648\u0639 \u062b\u0628\u062a\u200c\u0646\u0627\u0645", 
    "Ensure that you can see your photo and read your name": "\u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062d\u0627\u0635\u0644 \u0634\u0648\u062f \u06a9\u0647 \u0634\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0639\u06a9\u0633 \u062e\u0648\u062f \u0631\u0627 \u0645\u0634\u0627\u0647\u062f\u0647 \u06a9\u0646\u06cc\u062f \u0648 \u0646\u0627\u0645 \u062e\u0648\u062f  \u062e\u0648\u0627\u0646\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f", 
    "Enter a username or email.": "\u06cc\u06a9 \u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc \u06cc\u0627 \u0627\u06cc\u0645\u06cc\u0644 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.", 
    "Enter email addresses and/or usernames, separated by new lines or commas, for the learners you want to add. *": "\u0646\u0627\u0645\u200c\u06a9\u0627\u0631\u0628\u0631\u06cc/\u0627\u06cc\u0645\u06cc\u0644 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646\u06cc \u0631\u0627 \u06a9\u0647 \u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u06cc\u062f \u062f\u0631 \u0627\u06cc\u0646 \u06af\u0631\u0648\u0647 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f. (\u0628\u0635\u0648\u0631\u062a \u0647\u0631 \u0641\u0631\u0627\u06af\u06cc\u0631 \u062f\u0631 \u06cc\u06a9 \u062e\u0637 \u06cc\u0627 \u0622\u0646\u0647\u0627 \u0631\u0627 \u0628\u0627 \u06a9\u0627\u0645\u0627 \u0627\u0632 \u0647\u0645 \u062c\u062f\u0627 \u06a9\u0646\u06cc\u062f)", 
    "Enter email addresses and/or usernames, separated by new lines or commas, for the students you want to add. *": "\u0628\u0631\u0627\u06cc \u062f\u0627\u0646\u0634\u062c\u0648\u06cc\u0627\u0646\u06cc \u06a9\u0647 \u0645\u06cc \u062e\u0648\u0627\u0647\u06cc\u062f \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f\u060c \u0622\u062f\u0631\u0633 \u0627\u06cc\u0645\u06cc\u0644 \u0648/\u06cc\u0627 \u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0647\u0627 \u0631\u0627 \u06a9\u0647 \u0628\u0627 \u062e\u0637 \u062c\u062f\u06cc\u062f \u0648 \u06cc\u0627 \u06a9\u0627\u0645\u0627 \u0627\u0632 \u0647\u0645 \u062c\u062f\u0627 \u0634\u062f\u0647\u060c \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f. *", 
    "Enter information to describe your team. You cannot change these details after you create the team.": "\u0645\u062a\u0646\u06cc \u0628\u0646\u0648\u06cc\u0633\u06cc\u062f \u06a9\u0647 \u062f\u0631\u0628\u0627\u0631\u0647 \u062f\u0648\u0631\u0647 \u0634\u0645\u0627 \u0627\u0637\u0644\u0627\u0639\u0627\u062a\u06cc \u0627\u0631\u0627\u0626\u0647 \u06a9\u0646\u062f. \u0627\u0645\u06a9\u0627\u0646 \u0648\u06cc\u0631\u0627\u06cc\u0634 \u0627\u06cc\u0646 \u062c\u0632\u0626\u06cc\u0627\u062a \u067e\u0633 \u0627\u0632 \u0627\u06cc\u062c\u0627\u062f \u062a\u06cc\u0645 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f.", 
    "Enter the name of the cohort": "\u0646\u0627\u0645 \u06af\u0631\u0648\u0647 \u0622\u0645\u0648\u0632\u0634\u06cc \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f", 
    "Enter username or email": "\u0646\u0627\u0645\u200c\u06a9\u0627\u0631\u0628\u0631\u06cc \u06cc\u0627 \u0627\u06cc\u0645\u06cc\u0644 \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f", 
    "Enter your question or comment": "\u0633\u0648\u0627\u0644 \u06cc\u0627 \u0645\u0637\u0644\u0628 \u062e\u0648\u062f \u0631\u0627 \u0648\u0627\u0631\u062f \u0646\u0645\u0627\u06cc\u06cc\u062f", 
    "Enter your question or comment.": "\u0633\u0648\u0627\u0644 \u06cc\u0627 \u0645\u0637\u0644\u0628 \u062e\u0648\u062f \u0631\u0627 \u0648\u0627\u0631\u062f \u0646\u0645\u0627\u06cc\u06cc\u062f", 
    "Error": "\u062e\u0637\u0627", 
