    "Error adding/removing users as beta testers.": "\u062e\u0637\u0627 \u062f\u0631 \u062d\u0630\u0641 \u06cc\u0627 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0631\u062f\u0646 \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0622\u0632\u0645\u0627\u06cc\u0634 \u06a9\u0646\u0646\u062f\u0647.", 
    "Error changing user's permissions.": "\u062f\u0631 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0633\u062a\u0631\u0633\u06cc \u0647\u0627\u06cc \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u062e\u0637\u0627\u06cc\u06cc \u0631\u062e \u062f\u0627\u062f\u0647 \u0627\u0633\u062a.", 
    "Error deleting student '<%= student_id %>'s state on problem '<%= problem_id %>'. Make sure that the problem and student identifiers are complete and correct.": "\u062e\u0637\u0627 \u062f\u0631 \u062d\u0630\u0641 \u0648\u0636\u0639\u06cc\u062a \u062f\u0627\u0646\u0634\u062c\u0648 '<%= student_id %>' \u062f\u0631 \u0645\u0633\u0626\u0644\u0647 '<%= problem_id %>'. \u0644\u0637\u0641\u0627 \u0627\u0632 \u0635\u062d\u062a \u0645\u0633\u0626\u0644\u0647 \u0648 \u0634\u0646\u0627\u0633\u0647 \u062f\u0627\u0646\u0634\u062c\u0648 \u0648\u0627\u0631\u062f \u0634\u062f\u0647 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062d\u0627\u0635\u0644 \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "Error enrolling/unenrolling users.": "\u062e\u0637\u0627\u06cc\u06cc \u062f\u0631 \u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u0627 '\u062b\u0628\u062a \u0646\u0627\u0645'/'\u062d\u0630\u0641 \u062b\u0628\u062a \u0646\u0627\u0645' \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u0631\u062e \u062f\u0627\u062f\u0647 \u0627\u0633\u062a.", 
    "Error getting student progress url for '<%= student_id %>'. Make sure that the student identifier is spelled correctly.": "\u062e\u0637\u0627 \u062f\u0631 \u062f\u0631\u06cc\u0627\u0641\u062a \u0635\u0641\u062d\u0647 \u067e\u06cc\u0634\u0631\u0641\u062a \u062f\u0627\u0646\u0634\u062c\u0648 \u0628\u0631\u0627\u06cc '<%= student_id %>'. \u0644\u0637\u0641\u0627 \u0627\u0632 \u0635\u062d\u062a \u0634\u0646\u0627\u0633\u0647 \u0648\u0627\u0631\u062f \u0634\u062f\u0647 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062d\u0627\u0635\u0644 \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "Error getting task history for problem '<%= problem_id %>' and student '<%= student_id %>'. Make sure that the problem and student identifiers are complete and correct.": "\u062e\u0637\u0627 \u062f\u0631 \u062f\u0631\u06cc\u0627\u0641\u062a \u062a\u0627\u0631\u06cc\u062e\u0686\u0647 \u0639\u0645\u0644\u06cc\u0627\u062a \u0645\u0633\u0626\u0644\u0647 '<%= problem_id %>' \u0648 \u062f\u0627\u0646\u0634\u062c\u0648\u06cc '<%= student_id %>'. \u0644\u0637\u0641\u0627 \u0627\u0632 \u0635\u062d\u062a \u0645\u0633\u0626\u0644\u0647 \u0648 \u0634\u0646\u0627\u0633\u0647 \u062f\u0627\u0646\u0634\u062c\u0648 \u0648\u0627\u0631\u062f \u0634\u062f\u0647 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062d\u0627\u0635\u0644 \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "Error importing course": "\u062e\u0637\u0627 \u062f\u0631 \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u062f\u0648\u0631\u0647", 
    "Error listing task history for this student and problem.": "\u062e\u0637\u0627 \u062f\u0631 \u0646\u0645\u0627\u06cc\u0634 \u062a\u0627\u0631\u06cc\u062e\u0686\u0647 \u06a9\u0627\u0631\u0647\u0627 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0641\u0631\u0627\u06af\u06cc\u0631 (Learner) \u06cc\u0627 \u0645\u0633\u0626\u0644\u0647.", 
    "Error removing user": "\u062e\u0637\u0627 \u062f\u0631 \u062d\u0630\u0641 \u06a9\u0627\u0631\u0628\u0631", 
