    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "\u0627\u06af\u0631 \u0632\u06cc\u0631\u0641\u0635\u0644 \u0645\u0647\u0644\u062a \u067e\u0627\u06cc\u0627\u0646\u06cc \u0646\u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u062f\u060c \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0647\u0645\u0648\u0627\u0631\u0647 \u067e\u0633 \u0627\u0632 \u062b\u0628\u062a \u067e\u0627\u0633\u062e \u062a\u0645\u0631\u06cc\u0646 \u0646\u0645\u0631\u0647 \u062e\u0648\u062f \u0631\u0627 \u0645\u06cc\u200c\u0628\u06cc\u0646\u0646\u062f.", 
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "\u0627\u06af\u0631 \u062f\u0631\u0633 \u0642\u0628\u0644\u0627 \u0628\u0631\u0627\u06cc \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0645\u0646\u062a\u0634\u0631 \u0634\u062f\u0647 \u0628\u0648\u062f\u060c \u0647\u0631 \u062a\u063a\u06cc\u06cc\u0631\u06cc \u06a9\u0647 \u062f\u0631 \u0632\u0645\u0627\u0646 \u0645\u062e\u0641\u06cc \u0628\u0648\u062f\u0646 \u0622\u0646 \u062f\u0631 \u0622\u0646 \u062f\u0627\u062f\u0647 \u0628\u0648\u062f\u06cc\u062f \u0627\u06a9\u0646\u0648\u0646 \u0628\u0631\u0627\u06cc \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0642\u0627\u0628\u0644 \u0645\u0634\u0627\u0647\u062f\u0647 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f. \u0622\u06cc\u0627 \u0645\u0627\u06cc\u0644 \u0628\u0647 \u0627\u062f\u0627\u0645\u0647 \u0647\u0633\u062a\u06cc\u062f\u061f", 
    "If you leave, you can no longer post in this team's discussions. Your place will be available to another learner.": "\u0627\u06af\u0631 \u062e\u0627\u0631\u062c \u0634\u0648\u06cc\u062f\u060c \u062f\u06cc\u06af\u0631 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u062f\u0631 \u062a\u0627\u0644\u0627\u0631 \u06af\u0641\u062a\u06af\u0648 \u067e\u0633\u062a\u06cc \u0628\u0641\u0631\u0633\u062a\u06cc\u062f. \u062c\u0627\u06cc \u0634\u0645\u0627 \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0641\u0631\u0627\u06af\u06cc\u0631 \u062f\u06cc\u06af\u0631 \u062f\u0631\u200c\u062f\u0633\u062a\u0631\u0633 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f.", 
    "If you make significant changes, make sure you notify members of the team before making these changes.": "\u0627\u06af\u0631 \u0645\u06cc\u200c\u200c\u062e\u0648\u0627\u0647\u06cc\u062f \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a \u0642\u0627\u0628\u0644\u200c\u062a\u0648\u062c\u0647\u06cc \u0627\u0646\u062c\u0627\u0645\u200c\u062f\u0647\u06cc\u062f\u060c \u0627\u0632 \u0642\u0628\u0644 \u0628\u0647 \u0627\u0639\u0636\u0627\u06cc \u062a\u06cc\u0645 \u0627\u0637\u0644\u0627\u0639\u200c\u062f\u0647\u06cc\u062f.", 
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "\u0627\u06af\u0631 \u0627\u06cc\u0646 %(xblockType)s \u0631\u0627 \u0628\u0631\u0627\u06cc \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0642\u0627\u0628\u0644 \u0645\u0634\u0627\u0647\u062f\u0647 \u06a9\u0646\u06cc\u062f\u060c \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u067e\u0633 \u0627\u0632 \u06af\u0630\u0634\u062a \u0632\u0645\u0627\u0646 \u062f\u0631 \u0627\u062e\u062a\u06cc\u0627\u0631 \u0642\u0631\u0627\u0631 \u06af\u0631\u0641\u062a\u0646 \u0645\u062d\u062a\u0648\u0627 \u0622\u0646 \u0631\u0627 \u0628\u0628\u06cc\u0646\u0646\u062f. \u062a\u0646\u0647\u0627 \u062f\u0631\u0648\u0633\u06cc \u06a9\u0647 \u062e\u0648\u062f \u0646\u06cc\u0632 \u0627\u0632 \u0646\u06af\u0627\u0647 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u067e\u0646\u0647\u0627\u0646 \u0634\u062f\u0647\u200c\u0627\u0646\u062f \u067e\u0633 \u0627\u0632 \u067e\u0627\u06a9 \u0646\u0645\u0648\u062f\u0646 \u06af\u0632\u06cc\u0646\u0647 \u067e\u0646\u0647\u0627\u0646 \u0628\u0648\u062f\u0646 %(xblockType)s \u0647\u0645\u0686\u0646\u0627\u0646 \u067e\u0646\u0647\u0627\u0646 \u0628\u0627\u0642\u06cc \u0645\u06cc\u200c\u0645\u0627\u0646\u0646\u062f.", 
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "\u0686\u0646\u0627\u0646\u0686\u0647 \u0627\u0632 \u0648\u06cc\u0631\u0627\u06cc\u0634\u06af\u0631 \u067e\u06cc\u0634\u0631\u0641\u062a\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f\u060c \u0641\u0631\u0645\u062a \u0627\u06cc\u0646 \u0645\u0633\u0626\u0644\u0647 \u0628\u0647 XML \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f\u0647 \u0648 \u0627\u0645\u06a9\u0627\u0646 \u0628\u0627\u0632\u06af\u0634\u062a \u0628\u0647 \u0648\u06cc\u0631\u0627\u06cc\u0634\u06af\u0631 \u0633\u0627\u062f\u0647 \u067e\u0633 \u0627\u0632 \u0622\u0646 \u0648\u062c\u0648\u062f \u0646\u062e\u0648\u0627\u0647\u062f \u062f\u0627\u0634\u062a. \u0648\u06cc\u0631\u0627\u0634\u06af\u0631 \u067e\u06cc\u0634\u0631\u0641\u0631\u0641\u062a\u0647 \u0628\u0627\u0632 \u0634\u0648\u062f \u0648 \u0641\u0631\u0645\u062a \u0645\u0633\u0626\u0644\u0647 \u0628\u0647 XML \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0646\u062f\u061f", 
