    "Learners do not see whether their answers to assessments were correct or incorrect, nor the score received, until after the due date for the subsection has passed.": "\u0686\u0647 \u067e\u0627\u0633\u062e \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0628\u0647 \u062a\u0645\u0631\u06cc\u0646 \u0635\u062d\u06cc\u062d \u0628\u0627\u0634\u062f \u0648 \u0686\u0647 \u063a\u0644\u0637 \u062a\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0645\u0647\u0644\u062a \u067e\u0627\u06cc\u0627\u0646\u06cc \u0628\u0631\u0627\u06cc \u0632\u06cc\u0631\u0641\u0635\u0644 \u0646\u06af\u0630\u0631\u062f\u060c \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u0646\u062a\u06cc\u062c\u0647 \u0627\u0631\u0632\u06cc\u0627\u0628\u06cc \u06cc\u0627 \u0646\u0645\u0631\u0647 \u062e\u0648\u062f \u0631\u0627 \u0628\u0628\u06cc\u0646\u0646\u062f.", 
