    "No results found for \"%(query_string)s\". Please try searching again.": "\u0647\u06cc\u0686 \u0646\u062a\u06cc\u062c\u0647\u200c\u0627\u06cc \u0628\u0631\u0627\u06cc  \"%(query_string)s\" \u06cc\u0627\u0641\u062a \u0646\u0634\u062f. \u0644\u0637\u0641\u0627 \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f.", 
    "No results found for {original_query}. Showing results for {suggested_query}.": "\u0647\u06cc\u0686 \u0646\u062a\u06cc\u062c\u0647 \u0627\u06cc \u0628\u0631\u0627\u06cc {original_query} \u06cc\u0627\u0641\u062a \u0646\u0634\u062f. \u0646\u062a\u0627\u06cc\u062c \u0645\u0631\u0628\u0648\u0637  \u0628\u0647 {suggested_query} \u0646\u0645\u0627\u06cc\u0634 \u062f\u0627\u062f\u0647 \u0634\u062f\u0647 \u0627\u0646\u062f.", 
    "No sources": "\u0645\u0646\u0628\u0639 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f", 
    "No tasks currently running.": "\u0647\u0645 \u0627\u06a9\u0646\u0648\u0646 \u0647\u06cc\u0686 \u06a9\u0627\u0631\u06cc \u062f\u0631 \u062d\u0627\u0644 \u0627\u0646\u062c\u0627\u0645 \u0646\u06cc\u0633\u062a.", 
    "No threads matched your query.": "\u0647\u06cc\u0686 \u0645\u0648\u0636\u0648\u0639\u06cc \u062f\u0631 \u0645\u0648\u0631\u062f \u062c\u0633\u062a \u0648 \u062c\u0648\u06cc \u0634\u0645\u0627 \u06cc\u0627\u0641\u062a \u0646\u0634\u062f.", 
    "No validation is performed on policy keys or value pairs. If you are having difficulties, check your formatting.": "\u062a\u063a\u06cc\u06cc\u0631\u0627\u062a \u0627\u0646\u062c\u0627\u0645 \u0634\u062f\u0647 \u0628\u0631\u0631\u0648\u06cc \u0645\u0642\u0627\u062f\u06cc\u0631 \u062a\u0646\u0638\u06cc\u0645\u0627\u062a \u0627\u0639\u062a\u0628\u0627\u0631\u0633\u0646\u062c\u06cc \u0646\u0634\u062f\u0647 \u0627\u0633\u062a. \u0686\u0646\u0627\u0646\u0686\u0647 \u0645\u0634\u06a9\u0644\u06cc \u062f\u0627\u0631\u06cc\u062f\u060c \u0641\u0631\u0645\u062a \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0648\u0627\u0631\u062f \u0634\u062f\u0647 \u0631\u0627 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0646\u06cc\u062f.", 
    "Noncommercial": "\u063a\u06cc\u0631 \u062a\u062c\u0627\u0631\u06cc", 
    "None": "\u0647\u06cc\u0686\u06a9\u062f\u0627\u0645", 
