    "Not able to set passing grade to less than %(minimum_grade_cutoff)s%.": "\u0646\u0645\u0631\u06c0 \u0642\u0628\u0648\u0644\u06cc \u062f\u0631 \u062f\u0631\u0633 \u0646\u0628\u0627\u06cc\u062f \u06a9\u0645\u062a\u0631 \u0627\u0632  %(minimum_grade_cutoff)s% \u0628\u0627\u0634\u062f.", 
    "Not divided": "\u0628\u062e\u0634\u200c\u0628\u0646\u062f\u06cc \u0646\u0634\u062f\u0647", 
    "Not in Use": "\u0628\u0644\u0627\u0627\u0633\u062a\u0641\u0627\u062f\u0647", 
    "Not selected": "\u0627\u0646\u062a\u062e\u0627\u0628 \u0646\u0634\u062f\u0647", 
    "Note": "\u06cc\u0627\u062f\u062f\u0627\u0634\u062a", 
    "Note: Do not hide graded assignments after they have been released.": "\u062a\u0648\u062c\u0647: \u0644\u0637\u0641\u0627 \u067e\u0633 \u0627\u0632 \u0622\u0646\u06a9\u0647 \u062f\u0631\u0633 \u062f\u0631 \u0627\u062e\u062a\u06cc\u0627\u0631 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0642\u0631\u0627\u0631 \u06af\u0631\u0641\u062a \u062a\u06a9\u0627\u0644\u06cc\u0641 \u0646\u0645\u0631\u0647\u200c\u062f\u0627\u0631 \u0631\u0627 \u0627\u0632 \u062f\u06cc\u062f \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u067e\u0646\u0647\u0627\u0646 \u0646\u06a9\u0646\u06cc\u062f.", 
    "Note: Learners can be in only one cohort. Adding learners to this group overrides any previous group assignment.": "\u062f\u0631 \u0646\u0638\u0631 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u062f : \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u0641\u0642\u0637 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u062f\u0631 \u06cc\u06a9 \u06af\u0631\u0648\u0647 \u0622\u0645\u0648\u0632\u0634\u06cc \u0628\u0627\u0634\u0646\u062f. \u0628\u0627 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0631\u062f\u0646 \u0622\u0646\u0647\u0627 \u062f\u0631 \u0627\u06cc\u0646 \u06af\u0631\u0648\u0647\u060c \u0627\u0632 \u06af\u0631\u0648\u0647 \u0642\u0628\u0644\u06cc\u200c\u0634\u0627\u0646 \u062d\u0630\u0641 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f.", 
    "Note: Students can be in only one cohort. Adding students to this group overrides any previous group assignment.": "\u062a\u0648\u062c\u0647: \u062f\u0627\u0646\u0634\u062c\u0648\u06cc\u0627\u0646 \u062a\u0646\u0647\u0627 \u0645\u06cc \u062a\u0648\u0627\u0646\u0646\u062f \u062f\u0631 \u06cc\u06a9 \u06af\u0631\u0648\u0647 \u0628\u0627\u0634\u0646\u062f. \u0627\u0636\u0627\u0641\u0647 \u06a9\u0631\u062f\u0646 \u062f\u0627\u0646\u0634\u062c\u0648\u06cc\u0627\u0646 \u0628\u0647 \u0627\u06cc\u0646 \u06af\u0631\u0648\u0647\u060c \u0644\u063a\u0648 \u0647\u0631 \u0627\u0646\u062a\u0633\u0627\u0628 \u06af\u0631\u0648\u0647 \u0642\u0628\u0644\u06cc \u0627\u0633\u062a.", 
