    "Ok": "\u062e\u0648\u0628", 
    "Only <%= fileTypes %> files can be uploaded. Please select a file ending in <%= fileExtensions %> to upload.": "\u0641\u0642\u0637 \u0641\u0627\u06cc\u0644 \u0647\u0627\u06cc <%= fileTypes %> \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u0634\u0648\u0646\u062f. \u0644\u0637\u0641\u0627\u064b \u0642\u0633\u0645\u062a \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u0641\u0627\u06cc\u0644 \u0631\u0627 <%= fileExtensions %> \u062f\u0631 \u0642\u0633\u0645\u062a \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u0627\u0646\u062a\u062e\u0627\u0628 \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "Open Calculator": "\u0628\u0627\u0632 \u06a9\u0631\u062f\u0646 \u0645\u0627\u0634\u06cc\u0646 \u062d\u0633\u0627\u0628", 
    "Open/download this file": "\u0628\u0627\u0632\u06a9\u0631\u062f\u0646/ \u062f\u0627\u0646\u0644\u0648\u062f \u0627\u06cc\u0646 \u0641\u0627\u06cc\u0644", 
