    "Optional Characteristics": "\u0648\u06cc\u0698\u06af\u06cc\u200c\u0647\u0627\u06cc \u0645\u0646\u062d\u0635\u0631\u200c\u0628\u0647\u200c\u0641\u0631\u062f \u062a\u06cc\u0645", 
    "Optional long description": "\u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0627\u062e\u062a\u06cc\u0627\u0631\u06cc", 
    "Options for {license_name}": "\u062d\u0627\u0644\u062a\u200c\u0647\u0627\u06cc \u0645\u062e\u062a\u0644\u0641 \u0645\u062c\u0648\u0632 {license_name}", 
    "Order History": "\u062a\u0627\u0631\u06cc\u062e\u0686\u0647 \u0633\u0641\u0627\u0631\u0634", 
    "Order No.": "\u0634\u0645\u0627\u0631\u0647 \u0633\u0641\u0627\u0631\u0634.", 
