    "Organization": "\u0633\u0627\u0632\u0645\u0627\u0646", 
    "Other": "\u063a\u06cc\u0631\u0647", 
    "Page number out of %(total_pages)s": "\u0634\u0645\u0627\u0631\u0647 \u0635\u0641\u062d\u0647 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632  %(total_pages)s \u0627\u0633\u062a", 
