    "Password assistance": "\u0628\u0627\u0632\u06cc\u0627\u0628\u06cc \u0631\u0645\u0632 \u0639\u0628\u0648\u0631", 
    "Password reset email sent. Follow the link in the email to change your password.": "\u0627\u06cc\u0645\u06cc\u0644 \u062a\u063a\u06cc\u06cc\u0631 \u0631\u0645\u0632 \u0639\u0628\u0648\u0631 \u0628\u0631\u0627\u06cc \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f. \u0627\u0632 \u0644\u06cc\u0646\u06a9\u06cc \u06a9\u0647 \u062f\u0631 \u0627\u06cc\u0645\u06cc\u0644 \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f \u0628\u0631\u0627\u06cc \u062a\u063a\u06cc\u06cc\u0631 \u0631\u0645\u0632\u0639\u0628\u0648\u0631 \u062e\u0648\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f.", 
    "Pause": "\u0645\u06a9\u062b", 
    "Pending": "\u062f\u0631 \u0627\u0646\u062a\u0638\u0627\u0631", 
    "Phone Number": "\u0634\u0645\u0627\u0631\u0647 \u062a\u0645\u0627\u0633", 
