    "Play": "\u067e\u062e\u0634", 
    "Play video": "\u0641\u06cc\u0644\u0645 \u0631\u0627 \u067e\u062e\u0634 \u06a9\u0646", 
    "Please Note": "\u0644\u0637\u0641\u0627 \u062a\u0648\u062c\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u062f", 
    "Please add at least one chapter": "\u0644\u0637\u0641\u0627 \u062d\u062f\u0627\u0642\u0644 \u06cc\u06a9 \u0641\u0635\u0644 \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f", 
    "Please address the errors on this page first, and then save your progress.": "\u0644\u0637\u0641\u0627 \u0627\u0628\u062a\u062f\u0627 \u0628\u0647 \u0645\u0634\u06a9\u0644\u0627\u062a \u0645\u0648\u062c\u0648\u062f \u062f\u0631 \u0627\u06cc\u0646 \u0635\u0641\u062d\u0647 \u0631\u0633\u06cc\u062f\u06af\u06cc \u06a9\u0646\u06cc\u062f \u0648 \u0633\u067e\u0633 \u067e\u06cc\u0634\u0631\u0641\u062a \u062e\u0648\u062f \u0631\u0627 \u0630\u062e\u06cc\u0631\u0647 \u06a9\u0646\u06cc\u062f.", 
    "Please check your email to confirm the change": "\u0627\u06cc\u0645\u06cc\u0644 \u062e\u0648\u062f \u0631\u0627 \u0628\u0631\u0627\u06cc \u0644\u06cc\u0646\u06a9 \u062a\u063a\u06cc\u06cc\u0631 \u0631\u0645\u0632\u0639\u0628\u0648\u0631 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0646\u06cc\u062f", 
    "Please describe this image or agree that it has no contextual value by checking the checkbox.": "\u0644\u0637\u0641\u0627 \u062a\u0648\u0636\u06cc\u062d\u06cc \u0628\u0631\u0627\u06cc \u0639\u06a9\u0633 \u0628\u0646\u0648\u06cc\u0633\u06cc\u062f \u06cc\u0627 \u0628\u0627 \u0632\u062f\u0646 \u062a\u06cc\u06a9 \u0628\u0627\u06a9\u0633 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0645\u062d\u062a\u0648\u06cc\u0627\u062a \u0645\u062a\u0646\u06cc \u0628\u0631\u0627\u06cc \u0639\u06a9\u0633 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f.", 
    "Please do not use any spaces in this field.": "\u0644\u0637\u0641\u0627 \u0647\u06cc\u0686 \u0641\u0627\u0635\u0644\u0647 \u06cc\u0627 \u06a9\u0627\u0631\u0627\u06a9\u062a\u0631 \u062e\u0627\u0635\u06cc \u062f\u0631 \u0627\u06cc\u0646 \u0642\u0633\u0645\u062a \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u06a9\u0646\u06cc\u062f.", 
    "Please do not use any spaces or special characters in this field.": "\u0644\u0637\u0641\u0627 \u0647\u06cc\u0686 \u0641\u0627\u0635\u0644\u0647 \u06cc\u0627 \u06a9\u0627\u0631\u0627\u06a9\u062a\u0631 \u062e\u0627\u0635\u06cc \u062f\u0631 \u0627\u06cc\u0646 \u0642\u0633\u0645\u062a \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u06a9\u0646\u06cc\u062f.", 
    "Please enter a problem location.": "\u0644\u0637\u0641\u0627 \u06cc\u06a9 \u0645\u06a9\u0627\u0646 \u0645\u0633\u0626\u0644\u0647 \u0648\u0627\u0631\u062f \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "Please enter a student email address or username.": "\u0644\u0637\u0641\u0627 \u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc \u06cc\u0627 \u0627\u06cc\u0645\u06cc\u0644 \u06cc\u06a9 \u0641\u0631\u0627\u06af\u06cc\u0631 (Learner) \u0631\u0627 \u0648\u0627\u0631\u062f \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "Please enter a username or email.": "\u0644\u0637\u0641\u0627 \u06cc\u06a9 \u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc \u06cc\u0627 \u0627\u06cc\u0645\u06cc\u0644 \u0648\u0627\u0631\u062f \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "Please enter a valid email address": "\u0644\u0637\u0641\u0627 \u0627\u06cc\u0645\u06cc\u0644 \u0622\u062f\u0631\u0633 \u0633\u0627\u0644\u0645 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f", 
