    "See all teams in your course, organized by topic. Join a team to collaborate with other learners who are interested in the same topic as you are.": "\u062a\u0645\u0627\u0645\u06cc \u062a\u06cc\u0645\u200c\u0647\u0627 \u062f\u0631 \u062f\u0648\u0631\u0647 \u0634\u0645\u0627 \u0628\u0631\u200c\u0627\u0633\u0627\u0633 \u0645\u0648\u0636\u0648\u0639 \u062f\u0631 \u0627\u06cc\u0646 \u0642\u0633\u0645\u062a \u0646\u0645\u0627\u06cc\u0634 \u062f\u0627\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f. \u0639\u0636\u0648 \u06cc\u06a9 \u062a\u06cc\u0645 \u0634\u0648\u06cc\u062f \u062a\u0627 \u0628\u0627 \u062f\u06cc\u06af\u0631 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u06a9\u0647 \u0639\u0644\u0627\u0642\u0647\u200c\u0645\u0646\u062f \u0628\u0647 \u0645\u0648\u0636\u0648\u0639 \u062e\u0627\u0635\u06cc \u0647\u0633\u062a\u0646\u062f\u060c \u06af\u0641\u062a\u06af\u0648 \u06a9\u0646\u06cc\u062f.", 
