    "Select the time zone for displaying course dates. If you do not specify a time zone, course dates, including assignment deadlines, will be displayed in your browser's local time zone.": "\u0645\u062d\u062f\u0648\u062f\u0647 \u0632\u0645\u0627\u0646\u06cc \u062e\u0648\u062f \u0631\u0627 \u0628\u0631\u0627\u06cc \u0646\u0645\u0627\u06cc\u0634 \u062a\u0627\u0631\u06cc\u062e\u200c\u0647\u0627\u06cc \u062f\u0648\u0631\u0647 \u062e\u0648\u062f \u0628\u0647 \u0634\u06a9\u0644 \u0645\u062d\u0644\u06cc \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f. \u062f\u0631 \u063a\u06cc\u0631 \u0627\u06cc\u0646\u0635\u0648\u0631\u062a\u060c \u062a\u0645\u0627\u0645\u06cc \u062a\u0627\u0631\u06cc\u062e \u0647\u0627 \u0628\u0627 \u0645\u062d\u062f\u0648\u062f\u0647 \u0632\u0645\u0627\u0646\u06cc \u0645\u0631\u0648\u0631\u06af\u0631 \u0634\u0645\u0627 \u062a\u0646\u0637\u06cc\u0645 \u0645\u06cc \u0634\u0648\u0646\u062f.", 
