    "The email address you use to sign in. Communications from {platform_name} and your courses are sent to this address.": "\u0627\u06cc\u0646 \u0627\u06cc\u0645\u06cc\u0644\u06cc \u0627\u0633\u062a \u06a9\u0647 \u0634\u0645\u0627 \u0628\u0631\u0627\u06cc \u0648\u0631\u0648\u062f \u0628\u0647 \u0633\u0627\u0645\u0627\u0646\u0647 \u0627\u0632 \u0622\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc \u06a9\u0646\u06cc\u062f. \u067e\u0644 \u0627\u0631\u062a\u0628\u0627\u0637\u06cc \u0645\u06cc\u0627\u0646 \u0634\u0645\u0627 \u0648  {platform_name} \u0627\u0632 \u0637\u0631\u06cc\u0642 \u0627\u06cc\u0646 \u0622\u062f\u0631\u0633 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f.", 
