    "The general category for this type of assignment, for example, Homework or Midterm Exam. This name is visible to learners.": "\u062f\u0633\u062a\u0647 \u0639\u0645\u0648\u0645\u06cc \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0646\u0648\u0639 \u062a\u06a9\u0644\u06cc\u0641\u060c \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0645\u062b\u0627\u0644\u060c \u062a\u0645\u0631\u06cc\u0646 \u0645\u0646\u0632\u0644 \u06cc\u0627 \u0627\u0645\u062a\u062d\u0627\u0646 \u0645\u06cc\u0627\u0646\u062a\u0631\u0645. \u0627\u06cc\u0646 \u0646\u0627\u0645 \u0631\u0627 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u0628\u0628\u06cc\u0646\u0646\u062f.", 
