    "The language used throughout this site. This site is currently available in a limited number of languages.": "\u0632\u0628\u0627\u0646\u06cc \u06a9\u0647 \u062f\u0631 \u0627\u06cc\u0646 \u0633\u0627\u06cc\u062a \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc \u0634\u0648\u062f. \u0627\u06cc\u0646 \u0633\u0627\u06cc\u062a \u062f\u0631 \u062d\u0627\u0644 \u062d\u0627\u0636\u0631 \u062f\u0631 \u0632\u0628\u0627\u0646 \u0647\u0627\u06cc \u0645\u062d\u062f\u0648\u062f\u06cc \u062f\u0631\u200c \u062f\u0633\u062a\u0631\u0633 \u0627\u0633\u062a.", 
    "The minimum grade for course credit is not set.": "\u062d\u062f\u0627\u0642\u0644 \u0646\u0645\u0631\u0647 \u0642\u0628\u0648\u0644\u06cc \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u062f\u0631\u0633 \u062b\u0628\u062a \u0646\u0634\u062f\u0647 \u0627\u0633\u062a.", 
