    "The name that appears on your certificates. Other learners never see your full name.": " \u0633\u0627\u06cc\u0631 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u0646\u0645\u06cc \u062a\u0648\u0627\u0646\u0646\u062f \u0646\u0627\u0645 \u06a9\u0627\u0645\u0644 \u0634\u0645\u0627 \u0631\u0627 \u0628\u0628\u06cc\u0646\u0646\u062f.", 
