    "The post you selected has been deleted.": "\u067e\u0633\u062a\u06cc \u06a9\u0647 \u0634\u0645\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0647\u200c\u0627\u06cc\u062f \u067e\u0627\u06a9 \u0634\u062f\u0647 \u0627\u0633\u062a.", 
