    "Title:": "\u0639\u0646\u0648\u0627\u0646:", 
    "To be sure all students can access the video, we recommend providing both an .mp4 and a .webm version of your video. Click below to add a URL for another version. These URLs cannot be YouTube URLs. The first listed video that's compatible with the student's computer will play.": "\u0628\u0631\u0627\u06cc \u062d\u0635\u0648\u0644 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u0627\u0632 \u062f\u0633\u062a\u0631\u0633\u06cc \u062a\u0645\u0627\u0645\u06cc \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 (Learners) \u0628\u0647 \u0641\u06cc\u0644\u0645\u200c\u0647\u0627 \u062a\u0648\u0635\u06cc\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f \u0628\u0631\u0631\u0648\u06cc \u0647\u0631 \u062f\u0648 \u0641\u0631\u0645\u062a mp4. \u0648 webm. \u0641\u06cc\u0644\u0645 \u0631\u0627 \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f. \u062c\u0647\u062a \u0627\u0641\u0632\u0648\u062f\u0646 \u0633\u0627\u06cc\u0631 \u0646\u0633\u062e\u0647\u200c\u0647\u0627 \u0628\u0631 \u0631\u0648\u06cc URL \u0632\u06cc\u0631 \u06a9\u0644\u06cc\u06a9 \u06a9\u0646\u06cc\u062f. \u0627\u06cc\u0646 URL \u0647\u0627 \u0646\u0628\u0627\u06cc\u062f URL \u0641\u06cc\u0644\u0645\u200c\u0646\u06af\u0627\u0631 \u0628\u0627\u0634\u0646\u062f. \u0627\u0648\u0644\u06cc\u0646 \u0641\u06cc\u0644\u0645\u200c \u0633\u0627\u0632\u06af\u0627\u0631 \u062c\u0647\u062a \u0646\u0645\u0627\u06cc\u0634 \u062f\u0631 \u0633\u06cc\u0633\u062a\u0645 \u0641\u0631\u0627\u06af\u06cc\u0631 (Learner)\u060c \u0628\u0631\u0627\u06cc \u0627\u0648 \u0646\u0645\u0627\u06cc\u0634 \u062f\u0627\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f.", 
    "To review learner cohort assignments or see the results of uploading a CSV file, download course profile information or cohort results on the {link_start}Data Download{link_end} page.": "\u0628\u0631\u0627\u06cc \u0628\u0631\u0631\u0633\u06cc \u0627\u0636\u0627\u0641\u0647\u200c\u0634\u062f\u0646 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u0628\u0647 \u06af\u0631\u0648\u0647\u200c\u0647\u0627\u06cc \u0622\u0645\u0648\u0632\u0634\u06cc \u06cc\u0627 \u0628\u0631\u0631\u0633\u06cc \u0646\u062a\u06cc\u062c\u0647 \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u0641\u0627\u06cc\u0644 CSV\u060c \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u062f\u0648\u0631\u0647 \u06cc\u0627 \u0646\u062a\u06cc\u062c\u0647 \u06af\u0631\u0648\u0647\u200c\u0647\u0627 \u0631\u0627 \u062f\u0631 {link_start}\u0627\u06cc\u0646 \u0635\u0641\u062d\u0647{link_end} \u062f\u0627\u0646\u0644\u0648\u062f \u06a9\u0646\u06cc\u062f.", 
    "To review student cohort assignments or see the results of uploading a CSV file, download course profile information or cohort results on the {link_start}Data Download{link_end} page.": "\u062c\u0647\u062a \u0628\u0631\u0631\u0633\u06cc \u062a\u06a9\u0627\u0644\u06cc\u0641 \u06af\u0631\u0648\u0647\u06cc \u062f\u0627\u0646\u0634\u062c\u0648 \u0648 \u06cc\u0627 \u0645\u0634\u0627\u0647\u062f\u0647 \u0646\u062a\u0627\u06cc\u062c \u0622\u067e\u0644\u0648\u062f \u0641\u0627\u06cc\u0644 CSV \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u067e\u0631\u0648\u0641\u0627\u06cc\u0644 \u062f\u0648\u0631\u0647 \u0648 \u06cc\u0627 \u0646\u062a\u0627\u06cc\u062c \u06af\u0631\u0648\u0647 \u0631\u0627 \u0627\u0632 %(link_start)s \u0635\u0641\u062d\u0647 \u062f\u0627\u0646\u0644\u0648\u062f \u062f\u0627\u062f\u0647 \u0647\u0627 %(link_end)s \u062f\u0631\u06cc\u0627\u0641\u062a \u0646\u0645\u0627\u06cc\u06cc\u062f", 
