    "Use as a Prerequisite": "\u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0628\u062e\u0634 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u067e\u06cc\u0634\u200c\u0646\u06cc\u0627\u0632", 
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "\u0628\u0631\u0627\u06cc \u0628\u062e\u0634\u200c\u0628\u0646\u062f\u06cc \u06af\u0641\u062a\u06af\u0648\u0647\u0627 \u0627\u0632 \u06af\u0631\u0648\u0647 \u0622\u0645\u0648\u0632\u0634\u06cc \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f. \u0647\u0645\u0647 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u0628\u062f\u0648\u0646 \u062a\u0648\u062c\u0647 \u0628\u0647 \u06af\u0631\u0648\u0647 \u0622\u0645\u0648\u0632\u0634\u06cc\u060c \u0647\u0645\u0647 \u0645\u0648\u0636\u0648\u0639\u0627\u062a \u06af\u0641\u062a\u06af\u0648 \u0631\u0627 \u0645\u06cc\u200c\u0628\u06cc\u0646\u0646\u062f \u0627\u0645\u0627 \u062f\u0631 \u0645\u0648\u0636\u0648\u0639\u0627\u062a \u0628\u062e\u0634\u200c\u0628\u0646\u062f\u06cc \u0634\u062f\u0647\u060c \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646\u06cc \u06a9\u0647 \u06af\u0631\u0648\u0647\u200c \u0622\u0645\u0648\u0632\u0634\u06cc \u0622\u0646\u0647\u0627 \u0628\u0627 \u0647\u0645 \u0645\u0634\u0627\u0628\u0647 \u0627\u0633\u062a \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u067e\u0633\u062a\u200c\u0647\u0627\u06cc \u06cc\u06a9\u062f\u06cc\u06af\u0631 \u0631\u0627 \u062f\u06cc\u062f\u0647 \u0648 \u0628\u0647 \u0622\u0646\u0647\u0627 \u067e\u0627\u0633\u062e \u062f\u0647\u0646\u062f. ", 
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "\u0628\u0631\u0627\u06cc \u0628\u062e\u0634\u200c\u0628\u0646\u062f\u06cc \u06af\u0641\u062a\u06af\u0648\u0647\u0627 \u0627\u0632 \u0646\u0648\u0639 \u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f. \u0647\u0645\u0647 \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646 \u0628\u062f\u0648\u0646 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0646\u0648 \u0639 \u062b\u0628\u062a\u200c\u0646\u0627\u0645\u060c \u0647\u0645\u0647 \u0645\u0648\u0636\u0648\u0639\u0627\u062a \u06af\u0641\u062a\u06af\u0648 \u0631\u0627 \u0645\u06cc\u200c\u0628\u06cc\u0646\u0646\u062f \u0627\u0645\u0627 \u062f\u0631 \u0645\u0648\u0636\u0648\u0639\u0627\u062a \u0628\u062e\u0634\u200c\u0628\u0646\u062f\u06cc \u0634\u062f\u0647\u060c \u0641\u0631\u0627\u06af\u06cc\u0631\u0627\u0646\u06cc \u06a9\u0647 \u0646\u0648\u0639 \u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u0622\u0646\u0647\u0627 \u0628\u0627 \u0647\u0645 \u0645\u0634\u0627\u0628\u0647 \u0627\u0633\u062a \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u067e\u0633\u062a\u200c\u0647\u0627\u06cc \u06cc\u06a9\u062f\u06cc\u06af\u0631 \u0631\u0627 \u062f\u06cc\u062f\u0647 \u0648 \u0628\u0647 \u0622\u0646\u0647\u0627 \u067e\u0627\u0633\u062e \u062f\u0647\u0646\u062f.", 
    "Use the All Topics menu to find specific topics.": "\u0628\u0631\u0627\u06cc \u06cc\u0627\u0641\u062a\u0646 \u0645\u0648\u0636\u0648\u0639\u06cc \u062e\u0627\u0635\u060c \u0627\u0632 \u0645\u0646\u0648\u06cc \"\u0647\u0645\u0647 \u0645\u0648\u0636\u0648\u0639\u0627\u062a\" \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f.", 
