    "Vote for good posts and responses": "\u0628\u0647 \u067e\u0633\u062a\u200c\u0647\u0627 \u0648 \u067e\u0627\u0633\u062e\u200c\u0647\u0627\u06cc \u0645\u0641\u06cc\u062f \u0631\u0627\u06cc \u0628\u062f\u0647\u06cc\u062f", 
