    "We couldn't sign you in.": "\u0646\u062a\u0648\u0627\u0646\u0633\u062a\u06cc\u0645 \u0634\u0645\u0627 \u0631\u0627 \u0648\u0627\u0631\u062f \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc\u200c\u062a\u0627\u0646 \u06a9\u0646\u06cc\u0645.", 
    "We had some trouble loading the discussion. Please try again.": "\u0645\u0627 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631\u06af\u0632\u0627\u0631\u06cc \u06af\u0641\u062a\u06af\u0648 \u0628\u0647 \u0645\u0634\u06a9\u0644 \u0628\u0631\u062e\u0648\u0631\u062f\u0647 \u0627\u06cc\u0645\u060c \u0644\u0637\u0641\u0627 \u0645\u062c\u062f\u062f\u0627 \u062a\u0644\u0627\u0634 \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "We had some trouble loading the threads you requested. Please try again.": "\u0645\u0627 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631\u06af\u0632\u0627\u0631\u06cc \u0645\u0648\u0636\u0648\u0639\u0627\u062a\u06cc \u06a9\u0647 \u0634\u0645\u0627 \u062e\u0648\u0627\u0633\u062a\u0647 \u0627\u06cc\u062f \u0628\u0647 \u0645\u0634\u06a9\u0644 \u0628\u0631\u062e\u0648\u0631\u062f\u0647 \u0627\u06cc\u0645\u060c \u0644\u0637\u0641\u0627 \u0645\u062c\u062f\u062f\u0627 \u062a\u0644\u0627\u0634 \u0646\u0645\u0627\u06cc\u06cc\u062f.", 
    "We had some trouble processing your request. Please ensure you have copied any ": "\u0645\u0627 \u0628\u0631\u0627\u06cc \u0627\u0646\u062c\u0627\u0645 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0634\u0645\u0627 \u0628\u0647 \u0645\u0634\u06a9\u0644 \u0628\u0631\u062e\u0648\u0631\u062f\u0647 \u0627\u06cc\u0645. \u0644\u0637\u0641\u0627 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062d\u0627\u0635\u0644 \u0641\u0631\u0645\u0627\u06cc\u06cc\u062f \u06a9\u0647 \u06a9\u067e\u06cc \u06a9\u0631\u062f\u0647 \u0627\u06cc\u062f\u060c \u0647\u0645\u0647 ", 
    "We have encountered an error. Refresh your browser and then try again.": "\u0645\u0634\u06a9\u0644\u06cc \u0628\u0648\u062c\u0648\u062f \u0622\u0645\u062f\u0647 \u0627\u0633\u062a. \u0635\u0641\u062d\u0647 \u0645\u0631\u0648\u0631\u06af\u0631 \u062e\u0648\u062f \u0631\u0627 \u062a\u0627\u0632\u0647\u200c\u0633\u0627\u0632\u06cc \u06a9\u0646\u06cc\u062f \u0648 \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f.", 
    "We weren't able to send you a password reset email.": "\u0646\u062a\u0648\u0627\u0646\u0633\u062a\u06cc\u0645 \u0627\u06cc\u0645\u06cc\u0644 \u062a\u063a\u06cc\u06cc\u0631 \u0631\u0645\u0632 \u0631\u0627 \u0628\u0631\u0627\u06cc \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u06cc\u0645.", 
    "We're sorry, there was an error": "\u0645\u062a\u0623\u0633\u0641\u06cc\u0645\u060c \u062e\u0637\u0627\u06cc\u06cc \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f", 
    "We've encountered an error. Refresh your browser and then try again.": "\u0645\u0634\u06a9\u0644\u06cc \u0628\u0648\u062c\u0648\u062f \u0622\u0645\u062f\u0647 \u0627\u0633\u062a. \u0635\u0641\u062d\u0647 \u0645\u0631\u0648\u0631\u06af\u0631 \u062e\u0648\u062f \u0631\u0627 \u062a\u0627\u0632\u0647\u200c\u0633\u0627\u0632\u06cc \u06a9\u0646\u06cc\u062f \u0648 \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f.", 
    "We've sent instructions for resetting your password to the email address you provided.": "\u062f\u0633\u062a\u0648\u0631\u0627\u0644\u0639\u0645\u0644 \u0628\u0627\u0632\u06cc\u0627\u0628\u06cc \u0631\u0645\u0632 \u0639\u0628\u0648\u0631 \u0628\u0647 \u0627\u06cc\u0645\u06cc\u0644 \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f.", 
